import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./Header.jsx";
import Register from "./Register.jsx";
import Login from "./Login.jsx";
import Prod from "./Prod.jsx";

export default function App() {
  return (
    <Router>
      <div className="app">
        <Header />

        <Routes>
          {/* Home Page */}
          <Route path="/" element={<Home />} />

          {/* Register Page */}
          <Route path="/register" element={<Register />} />

          {/* Login Page */}
          <Route path="/login" element={<Login />} />

          {/* Products Page */}
          <Route path="/products" element={<Products />} />

          {/* Customized Order Page */}
          <Route path="/custom-order" element={<CustomOrder />} />
        </Routes>
      </div>
    </Router>
  );
}

// Home Component
function Home() {
  return (
    <main className="hero-section first-page">
      <div className="text-content">
        <h1>
          Design <br /> Your <br /> Dream T-Shirts
        </h1>
        <p>
          Choose from stylish presets or create your own by uploading designs,
          adding text, or graphics.
        </p>
        <button className="get-started" onClick={() => (window.location.href = "/login")}>
          Get Started
        </button>
      </div>
    </main>
  );
}

// Products Component
function Products() {
  return (
    <section className="products-section">
      <h2>Our Products</h2>
      <div className="products">
        <Prod />
        <Prod />
      </div>
    </section>
  );
}

// Custom Order Component
function CustomOrder() {
  return (
    <div className="customizeOrder">
      <h1>Customized Order Section</h1>
      <div className="custom_order"></div>
    </div>
  );
}
